A Substrate pallet is composed of 5 sections: // 1. Imports and Dependencies
// The pallet supports the use of any Rust library which compiles
// with the `no_std` flag.
use support::{decl_module, decl_event, decl_storage, ...} // 2. Runtime Configuration Trait
// All of the runtime types and consts go in here. If the pallet
// is dependent on specific other pallets, then their configuration traits
// should be added to the inherited traits list.
pub trait Config: frame_system::Config { ... } // 3. Runtime Events
// Events are a simple means of reporting specific conditions and circumstances
// that have happened that users, Dapps and/or chain explorers would find
// interesting and otherwise difficult to detect.
decl_event! { ... } // 4. Runtime Storage
// This allows for type-safe usage of the Substrate storage database, so you can
// keep things around between blocks.
decl_storage! { ... } // 5. The Pallet Declaration
// This defines the `Module` struct that is ultimately exported from this pallet.
// It defines the callable functions that this pallet exposes and orchestrates
// actions this pallet takes throughout block execution.
decl_module! { ... } Note : Additional sections such as decl_error! are commonly used however are not a requirement for a minimally working pallet. Example The Basic Token recipe provides a good example of a simple FRAME V1 pallet that allows a user to create a u64 supply of tokens in storage and a StorageMap of account IDs and u64 balances. The primary parts include: decl_storage! defines TotalSupply and Balances the pallet's storage items; decl_event! defines Initialized and Transfer events; decl_module! defines the pallet's functions, init() and transfer(); and decl_module! also has a deposit_event() function, common to all pallets that define behavior that emits an event.

