Here is a minimal, working pallet which simply allows a user to put a u64 value into storage: use support::{decl_module, decl_event, decl_storage, StorageValue, StorageMap};
use system::ensure_signed; pub trait Config: system::Config { // The traits the `Event` type used in this pallet has. type Event: From<Event<Self>> + Into<<Self as system::Config>::Event>;
} decl_event!{ pub enum Event<T> where AccountId = <T as system::Config>::AccountId, { // An event which is emitted when `set_value` is called. // Contains information about the user who called the function // and the value they called with. ValueSet(AccountId, u64), }
} decl_storage! { trait Store for Module<T: Config> as Example { // The last value passed to `set_value`. // Used as an example of a `StorageValue`. pub LastValue get(fn last_value): u64; // The value each user has put into `set_value`. // Used as an example of a `StorageMap`. pub UserValue get(fn user_value): map T::AccountId => u64; }
} decl_module! { pub struct Module<T: Config> for enum Call where origin: T::Origin { // A default function for depositing events in our runtime fn deposit_event() = default; // The only callable function of our runtime module. // Allows a user to set a `u64` value into the runtime storage. pub fn set_value(origin, value: u64) { let sender = ensure_signed(origin)?; LastValue::put(value); UserValue::<T>::insert(&sender, value); Self::deposit_event(RawEvent::ValueSet(sender, value)); } }
} The above example is similar to FRAME's Nicks pallet. For context, see: the FRAME v1 of the Nicks Pallet the FRAME v2 of the Nicks Pallet

