One important thing we need to call out with importing pallet crates is making sure to set up the crate features correctly. In the code snippet above, you will notice that we set default_features = false. If you explore the Cargo.toml file even closer, you will find something like: runtime/Cargo.toml [features]
default = ['std']
std = [ 'codec/std', 'serde', 'frame-executive/std', 'frame-support/std', 'frame-system/std', 'frame-system-rpc-runtime-api/std', 'pallet-aura/std', 'pallet-balances/std', #--snip--
] This second line defines the default features of your runtime crate as std. You can imagine, each pallet crate has a similar configuration defining the default feature for the crate. Your feature will determine the features that should be used on downstream dependencies. For example, the snippet above should be read as: The default feature for this Substrate runtime is std. When std feature is enabled for the runtime, codec, serde, frame-executive, frame-support, and all the other listed dependencies should use their std feature too. This is important to enable the Substrate runtime to compile to both native binaries, which support Rust std , and Wasm binaries, which do not (see: no_std ). The use of Wasm runtime binaries is one of Substrate's defining features. It allows the runtime code to become a part of a blockchain's evolving state; it also means that the definition of the runtime itself is subject to the cryptographic consensus mechanisms that ensure the security of the blockchain network. The usage of Wasm runtimes enables one of Substrate's most innovative features: forkless runtime upgrades, which means that Substrate blockchain nodes can stay up-to-date and even acquire new features without needing to be replaced with an updated application binary. To see how the std and no_std features are actually used in the runtime code, we can open the project file: runtime/src/lib.rs #![cfg_attr(not(feature = "std"), no_std)]
// `construct_runtime!` does a lot of recursion and requires us to increase the limit to 256.
#![recursion_limit="256"] // Make the WASM binary available.
#[cfg(feature = "std")]
include!(concat!(env!("OUT_DIR"), "/wasm_binary.rs")); // --snip-- You can see that at the top of the file, we define that we will use no_std when we are not using the std feature. A few lines lower you can see #[cfg(feature = "std")] above the wasm_binary.rs import, which is a flag saying to only import the Wasm binary when we have enabled the std feature.

