Every pallet has a component called Config that is used for configuration. This component is a Rust "trait" ; traits in Rust are similar to interfaces in languages such as C++, Java and Go. FRAME developers must implement this trait for each pallet they would like to include in a runtime in order to configure that pallet with the parameters and types that it needs from the outer runtime. For instance, in the template pallet that is included in the Node Template , you will see the following Config configuration trait: pallets/template/src/lib.rs /// Configure the pallet by specifying the parameters and types on which it depends.
pub trait Config: frame_system::Config { /// Because this pallet emits events, it depends on the runtime's definition of an event. type Event: From<Event<Self>> + Into<<Self as frame_system::Config>::Event>;
} As the comment states, we are using the Event type of the Config configuration trait in order to allow the TemplateModule pallet to emit a type of event that is compatible with the outer runtime. The Config configuration trait may also be used to tune parameters that control the resources required to interact with a pallet or even to limit the resources of the runtime that the pallet may consume. You will see examples of both such cases below when you implement the Config configuration trait for the Nicks pallet. To figure out what you need to implement for the Nicks pallet specifically, you can take a look at the pallet_nicks::Config documentation or the definition of the trait itself in the source code of the Nicks pallet. We have annotated the source code for nicks pallet from the substrate source below with enhanced comments that expand on those already included in the documentation, so be sure to read this: substrate/frame/nicks/src/lib.rs /// Already in the Nicks pallet included substrate (with enhanced comments):
pub trait Config: frame_system::Config { // The runtime must supply this pallet with an Event type that satisfies the pallet's requirements. type Event: From<Event<Self>> + Into<<Self as frame_system::Config>::Event>; // The currency type that will be used to place deposits on nicks. // It must implement ReservableCurrency. // https://substrate.dev/rustdocs/v3.0.0/frame_support/traits/trait.ReservableCurrency.html type Currency: ReservableCurrency<Self::AccountId>; // The amount required to reserve a nick. type ReservationFee: Get<BalanceOf<Self>>; // A callback that will be invoked when a deposit is forfeited. type Slashed: OnUnbalanced<NegativeImbalanceOf<Self>>; // Origins are used to identify network participants and control access. // This is used to identify the pallet's admin. // https://substrate.dev/docs/en/knowledgebase/runtime/origin type ForceOrigin: EnsureOrigin<Self::Origin>; // This parameter is used to configure a nick's minimum length. type MinLength: Get<usize>; // This parameter is used to configure a nick's maximum length. // https://substrate.dev/docs/en/knowledgebase/runtime/storage#create-bounds type MaxLength: Get<usize>;
} Just like we used the Balances pallet as a template for importing the Nicks pallet, let's use the Balances pallet as an example to help us understand how we can implement the Config interface for the Nicks pallet. You will notice that this implementation consists of two parts: a parameter_types! block where constant values are defined and an impl block where the types and values defined by the Config interface are configured. This code block has also been annotated with additional comments that you should be sure to read: runtime/src/lib.rs /// Already in your template for Balances:
parameter_types! { // The u128 constant value 500 is aliased to a type named ExistentialDeposit. pub const ExistentialDeposit: u128 = 500; // A heuristic that is used for weight estimation. pub const MaxLocks: u32 = 50;
} impl pallet_balances::Config for Runtime { // The previously defined parameter_type is used as a configuration parameter. type MaxLocks = MaxLocks; // The "Balance" that appears after the equal sign is an alias for the u128 type. type Balance = Balance; // The empty value, (), is used to specify a no-op callback function. type DustRemoval = (); // The previously defined parameter_type is used as a configuration parameter. type ExistentialDeposit = ExistentialDeposit; // The FRAME runtime system is used to track the accounts that hold balances. type AccountStore = System; // No weight information is supplied to the Balances pallet by the Node Template's runtime. type WeightInfo = (); // The ubiquitous event type. type Event = Event;
} The impl pallet_balances::Config block allows runtime developers that are including the Balances pallet in their runtime to configure the types and parameters that are specified by the Balances pallet Config configuration trait. For example, the impl block above configures the Balances pallet to use the u128 type to track balances. If you were developing a chain where it was important to optimize storage, you could use any unsigned integer type that was at least 32-bits in size; this is because the Balance type for the Balances pallet Config configuration trait is "bounded" by the AtLeast32BitUnsigned trait . Now that you have an idea of the purpose behind the Config configuration trait and how you can implement a FRAME pallet's Config interface for your runtime, let's implement the Config configuration trait for the Nicks pallet. Add the following code to your runtime: runtime/src/lib.rs /// Add this code block to your template for Nicks:
parameter_types! { // Choose a fee that incentivizes desireable behavior. pub const NickReservationFee: u128 = 100; pub const MinNickLength: usize = 8; // Maximum bounds on storage are important to secure your chain. pub const MaxNickLength: usize = 32;
} impl pallet_nicks::Config for Runtime { // The Balances pallet implements the ReservableCurrency trait. // https://substrate.dev/rustdocs/v3.0.0/pallet_balances/index.html#implementations-2 type Currency = pallet_balances::Module<Runtime>; // Use the NickReservationFee from the parameter_types block. type ReservationFee = NickReservationFee; // No action is taken when deposits are forfeited. type Slashed = (); // Configure the FRAME System Root origin as the Nick pallet admin. // https://substrate.dev/rustdocs/v3.0.0/frame_system/enum.RawOrigin.html#variant.Root type ForceOrigin = frame_system::EnsureRoot<AccountId>; // Use the MinNickLength from the parameter_types block. type MinLength = MinNickLength; // Use the MaxNickLength from the parameter_types block. type MaxLength = MaxNickLength; // The ubiquitous event type. type Event = Event;
}
